    def updateEmerBedTable(self,data):
        self.emergency_beds_data_thread.retrievalComplete.connect(self.emergency_beds_data_thread.quit)
        for row_number, row_data in enumerate(data):
            self.tableEmergencyBeds.insertRow(row_number)
            for column_number, column_data in enumerate(row_data):
                item = QtWidgets.QTableWidgetItem(str(column_data))
                self.tableEmergencyBeds.setItem(row_number, column_number, item)
    
    def showWarningMessage(self,message):
        msgBox = QtWidgets.QMessageBox()
        msgBox.setIcon(QtWidgets.QMessageBox.Warning)
        msgBox.setWindowTitle("Warning")
        msgBox.setText(message)
        msgBox.setStandardButtons(QtWidgets.QMessageBox.Ok)
        msgBox.exec_()

    def dataCheck(self):
        if ((len(self.patAddrEntry.text().strip())==0) or (len(self.patNameEntry.text().strip())==0) or
            (len(self.patAgeEntry.text().strip())==0) or (len(self.patGenderEntry.text().strip())==0) or 
            (len(self.patPhoneEntry.text().strip())==0) or (len(self.patReasonEntry.text().strip())==0)):
            self.showWarningMessage("All fields are mandatory!!")
        else:
            for i in self.patPhoneEntry.text().strip():
                if i.isalpha() or len(self.patPhoneEntry.text().strip())<10 or len(self.patPhoneEntry.text().strip())>10:
                    self.showWarningMessage("Phone number wrong!!")
                    return False
            if int(self.patPhoneEntry.text().strip())<=0:
                    self.showWarningMessage("Phone number wrong!!")
                    return False
            if self.patAgeEntry.text().strip().isalpha() or (self.patAgeEntry.text().strip().isalnum() and not self.patAgeEntry.text().strip().isdigit()):
                print("hi")
                self.showWarningMessage("Wrong Age Entry!!")
                return False
            elif int(floor(float(self.patAgeEntry.text().strip())))<=0:
                print("hey")
                self.showWarningMessage("Wrong Age Entry!!")
                return False
            return True

    def allotBed(self):
        if self.dataCheck():
            data = getSelectedRowData(self.tableEmergencyBeds)
            if data==None:
                self.showWarningMessage("Please choose the bed!!")
            else:
                processed_data = (self.patNameEntry.text(),self.patReasonEntry.text(),getCurrDate(),getCurrTime(),
                                  self.patGenderEntry.text(),self.patAgeEntry.text(),self.patAddrEntry.text(),
                                  self.patPhoneEntry.text(),data[0])
                pool = ConnectionPool(5, 'hms_database.db')
                updateAllotmentBedData(pool,processed_data)
                updateBedStatus(pool)
                self.refreshTable()
                

    def releaseBed(self):
        data = getSelectedRowData(self.tableEmergencyBeds)
        if data==None:
                self.showWarningMessage("Please choose the bed!!")
        else:
                pool = ConnectionPool(5, 'hms_database.db')
                processed_data = ('NA','NA','NA','NA','NA','NA','NA','NA',data[0])
                updateAllotmentBedData(pool,processed_data)
                updateBedStatus(pool)
                self.refreshTable()

